/// A collection reference object can be used for adding documents,
/// getting document references, and querying for documents
/// (using the methods inherited from Query).
abstract class HistoryCollectionReference
    implements
        HistoryQuery,
        FirestoreCollectionReference<History, HistoryQuerySnapshot> {
  factory HistoryCollectionReference(
    DocumentReference<User> parent,
  ) = _$HistoryCollectionReference;

  static History fromFirestore(
    DocumentSnapshot<Map<String, Object?>> snapshot,
    SnapshotOptions? options,
  ) {
    return History.fromJson({'id': snapshot.id, ...?snapshot.data()});
  }

  static Map<String, Object?> toFirestore(
    History value,
    SetOptions? options,
  ) {
    return {...value.toJson()}..remove('id');
  }

